async function generarPDF(btn) {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    const codigo = btn.getAttribute("data-codigo");
    const empleado = btn.getAttribute("data-empleado");
    const area = btn.getAttribute("data-area");
    const banco = btn.getAttribute("data-banco");
    const salarioBruto = btn.getAttribute("data-salario-bruto");
    const descuentos = btn.getAttribute("data-descuentos");
    const salarioNeto = btn.getAttribute("data-salario-neto");
    const periodo = btn.getAttribute("data-periodo");
    const id = btn.getAttribute("data-id");

    // Encabezado con logo de empresa
    const imgLogo =
      "data:image/png;base64,"; // Reemplazar con logo real
    doc.addImage(imgLogo, "JPEG", 15, 10, 30, 30);
    doc.setFont("helvetica", "bold");
    doc.setFontSize(16);
    doc.text("EMPRESA XYZ - BOLETA DE PAGO", 60, 25);

    // Datos del empleado
    doc.setFont("helvetica", "normal");
    doc.setFontSize(12);
    doc.text("Código: " + codigo, 15, 50);
    doc.text("Empleado: " + empleado, 15, 60);
    doc.text("Área: " + area, 15, 70);
    doc.text("Banco: " + banco, 15, 80);
    doc.text("Periodo de Pago: " + periodo, 15, 90);

    // Separador visual
    doc.line(15, 95, 195, 95);

    // Resumen salarial
    doc.setFontSize(14);
    doc.setFont("helvetica", "bold");
    doc.text("Detalles del Pago", 80, 105);

    doc.setFontSize(12);
    doc.setFont("helvetica", "normal");
    doc.text("Salario Bruto: S/ " + salarioBruto, 15, 120);
    doc.text("Descuentos Aplicados: S/ " + descuentos, 15, 130);

    doc.setFontSize(14);
    doc.setFont("helvetica", "bold");
    doc.text("Salario Neto: S/ " + salarioNeto, 15, 145);

    // Separador visual
    doc.line(15, 150, 195, 150);

    doc.save("BoletaPago_" + id + ".pdf");
  }
